import React from 'react';
import { Link } from 'react-router-dom';
import PizzaCard from './PizzaCard'


const PizzaCardList = ({pizzas}) => {
	const PizaComponent = pizzas.forEach((pizza, i) => {
    return (
      <PizzaCard
        id={pizzas[i].id}
        unit={pizzas[i].unit}
        name={pizzas[i].name} />
    )
  })
  return (
  	<div className="AllSabores">
  	<PizzaCard/>
    </div>
  );
};

export default PizzaCardList;
